import React from 'react';
import './Footer.scss';

function Footer() {
	return (
		<div className="app__footer flex__center">
			<h1>EMMIJOZZY</h1>
			<span className="year">2022</span>
			<h2>| All Right Reserved</h2>
		</div>
	);
}

export default Footer;
